import React from "react";
import HomeNavBar from "../components/HomeNavBar";

function Register() {
  return (
    <div className="flex h-screen">
      {/* Left Side*/}
      <div className="flex-1">
        <p>LEFT</p>
      </div>
      {/* Right Side */}
      <div className="flex-1">
        <p>RIGHT</p>
      </div>
    </div>
  );
}

export default Register;
